commonfields:
  id: SQS
  version: -1
name: SQS
display: Amazon SQS
category: IT Services
image: data:image/png;base64,
description: Manage messages in SQS
configuration:
- display: Access Key ID
  name: accesskeyid
  defaultvalue: ""
  type: 4
  required: false
- display: Secret Access Key
  name: secretaccesskey
  defaultvalue: ""
  type: 4
  required: false
- display: Region
  name: region
  defaultvalue: ""
  type: 0
  required: false
- display: QueueURL
  name: queue-url
  defaultvalue: ""
  type: 0
  required: false
- display: Fetch incidents
  name: isFetch
  defaultvalue: ""
  type: 8
  required: false
- display: Incident type
  name: incidentType
  defaultvalue: ""
  type: 13
  required: false
script:
  script: |
    import boto3
    import json

    #INITIALIZING PARAMS AND DATA
    AWS_ACCESS_KEY = demisto.params()['accesskeyid']
    AWS_SECRET_KEY = demisto.params()['secretaccesskey']
    AWS_REGION = demisto.params()['region']
    AWS_QUEUEURL = demisto.params()['queue-url']

    client = boto3.client(
            'sqs',
            aws_access_key_id=AWS_ACCESS_KEY,
            aws_secret_access_key=AWS_SECRET_KEY,
            region_name=AWS_REGION
            )

    #COMMAND FUNCTIONS
    def test_function():
        try:
            messages = client.receive_message(
                QueueUrl=AWS_QUEUEURL,
                MaxNumberOfMessages=2,
                VisibilityTimeout=5,
                WaitTimeSeconds=5,
                ReceiveRequestAttemptId='string'
                )
            return "ok"
        except:
            return "Error. Please check credentials, Queue URL, and/or proxy settings\n"

    def list_queues():
        prefix = demisto.args().get("queueNamePrefix") if demisto.args().get("queueNamePrefix") else ''
        try:
            res = client.list_queues(QueueNamePrefix=prefix)
        except:
            demisto.results({ 'Type' : entryTypes['error'], 'ContentsFormat' : formats['text'], 'Contents' : "Unable to complete command.  Please check credentials, Queue URL, and/or proxy settings\n" + str(e) })
            sys.exit(0)

        if "QueueUrls" not in res.keys():
            demisto.results("No QueueUrls have returned.")
            sys.exit(0)

        mdResult = []
        d={}
        for item in res['QueueUrls']:
            d['QueueUrl'] = item
            mdResult.append(d)

        demisto.results({
            'Type': entryTypes['note'],
            'ContentsFormat': formats['json'],
            'Contents': res,
            'ReadableContentsFormat': formats['markdown'],
            'HumanReadable': tableToMarkdown("Queue URLs", mdResult),
            'EntryContext': {
                'SQS.QueueUrls' : res["QueueUrls"]
                }
            })

    def send_message():
        try:
            res = client.send_message(
                QueueUrl=AWS_QUEUEURL,
                DelaySeconds=int((demisto.args()["Delay"])),
                MessageBody=(demisto.args()["Body"]),
            )
        except:
            demisto.results({
                'Type' : entryTypes['error'],
                'ContentsFormat' : formats['text'],
                'Contents' : "Unable to complete command.  Please check credentials, Queue URL, and/or proxy settings\n" + str(e)
            })
            sys.exit(0)

        res.pop('ResponseMetadata', None)

        demisto.results({
            'Type': entryTypes['note'],
            'ContentsFormat': formats['json'],
            'Contents': res,
            'ReadableContentsFormat': formats['markdown'],
            'HumanReadable': tableToMarkdown("Queue URLs", res),
            'EntryContext': {
                    'SQS.SentMessages(obj.MessageId==val.MessageId)': res
                    }
            })

    def delete_messages(receipt_handles):
        ''' Deletes messages that were recieved '''
        for receipt_handle in receipt_handles:
            client.delete_message(QueueUrl=AWS_QUEUEURL, ReceiptHandle=receipt_handle)

    def get_messages():
        ''' Gets messages from the Queue '''
        try:
            messages = client.receive_message(
                QueueUrl=AWS_QUEUEURL,
                MaxNumberOfMessages=10,
                VisibilityTimeout=5,
                WaitTimeSeconds=5,
                ReceiveRequestAttemptId='string'
            )
        except:
            demisto.results({
                'Type' : entryTypes['error'],
                'ContentsFormat' : formats['text'],
                'Contents' : "Unable to complete command.  Please check credentials, Queue URL, and/or proxy settings\n" + str(e)
            })
            sys.exit(0)

        receipt_handles = []
        incidents = []

        if "Messages" not in messages.keys():
            if demisto.command() == 'fetch-incidents':
                demisto.incidents([])
            return messages,incidents,receipt_handles


        for message in messages["Messages"]:
            receipt_handles.append(message['ReceiptHandle'])
            inc = {}

            try:
                body = json.loads(message["Body"])
                inc["name"] =  (body["alertId"] + ": " + body["policyName"]) if ("alertId" in body and "policyName" in body) else ("SQS MessageId: " + message["MessageId"])
            except:
                body = message["Body"]

            inc["rawJSON"] = message
            incidents.append(inc["rawJSON"])

        return messages,incidents,receipt_handles


    #EXECUTION

    if demisto.command() == 'test-module':
            demisto.results(test_function())

    if demisto.command() == 'sqs-list-queues':
        list_queues()
        sys.exit(0)

    if demisto.command() == 'sqs-send-message':
        send_message()
        sys.exit(0)

    if demisto.command() == 'fetch-incidents':
        incidents,receipt_handles = get_messages()
        demisto.incidents(incidents)

        if receipt_handles:
            delete_messages(receipt_handles)
        sys.exit(0)

    if demisto.command() == 'sqs-delete-messages':
        rec = demisto.args().get('receiptHandles', None)
        num = demisto.args().get('maxMessages', None)
        del_all = demisto.args().get('deleteAll', None)

        if(len(demisto.args()) != 1):
            demisto.results("Please enter exactly 1 argument")
            sys.exit(0)


        if rec and not num and not del_all:
            rec = demisto.args()["receiptHandles"]
            delete_messages(rec)
            demisto.results("Messages deleted.")
            sys.exit(0)

        if num and not rec and not del_all:
            i = int(num) / 10
            total = 0
            for j in range(i):
                messages,incidents,receipt_handles = get_messages()
                if receipt_handles:
                    delete_messages(receipt_handles)
                    total += len(receipt_handles)

            demisto.results(str(total) + " messages deleted.")
            sys.exit(0)

        if del_all and not num and not rec:
            total = 0
            stop = 1
            while(stop):
                messages,incidents,receipt_handles = get_messages()
                if receipt_handles:
                    delete_messages(receipt_handles)
                    total += len(receipt_handles)
                else:
                    stop = 0

            demisto.results(str(total) + " messages deleted.")
            sys.exit(0)


    if demisto.command() == 'sqs-get-messages':
        messages,incidents,receipt_handles = get_messages()
        if "Messages" not in messages.keys():
            demisto.results("No messages in the queue.")
        else:
            demisto.results({
                'Type': entryTypes['note'],
                'ContentsFormat': formats['json'],
                'Contents': messages,
                'ReadableContentsFormat': formats['markdown'],
                'HumanReadable': tableToMarkdown("Queue Messages", incidents),
                'EntryContext': {'SQS.Messages(obj.MD5OfBody==val.MD5OfBody)': messages["Messages"]}
            })
        sys.exit(0)

    sys.exit(0)
  type: python
  commands:
  - name: sqs-get-messages
    arguments: []
    outputs:
    - contextPath: SQS.Messages.Body
      description: Body of the message
      type: string
    - contextPath: SQS.Messages.MD5OfBody
      description: MD5 of the message
      type: string
    - contextPath: SQS.Messages.messageId
      description: ID of the message
      type: string
    - contextPath: SQS.Messages.ReceiptHandle
      description: Receipt handle of the message
      type: string
    description: Gets up to 10 messages from the Queue
  - name: sqs-delete-messages
    arguments:
    - name: maxMessages
      description: Max number of messages to be deleted(at least 10)
    - name: receiptHandles
      description: Provide ReceiptHandles identifier of message separated by comma.
        In order to receive RecieptHandles you can run the sqs-get-messages command.
      isArray: true
    - name: deleteAll
      auto: PREDEFINED
      predefined:
      - "yes"
      description: Deletes all the messages in the queue
    description: Deletes messages from the Queue. Exactly 1 of the arguments must
      be used.
  - name: sqs-list-queues
    arguments:
    - name: queueNamePrefix
      description: only queues with a name that begins with the specified value are
        returned.
    outputs:
    - contextPath: SQS.QueueUrls
      description: The URL of each Queue
      type: string
    description: Returns a list of your queues
  - name: sqs-send-message
    arguments:
    - name: Body
      required: true
      description: The message to be sent
    - name: Delay
      description: 'The length of time, in seconds, for which to delay a specific
        message. Valid values: 0 to 900'
      defaultValue: "0"
    outputs:
    - contextPath: SQS.SentMessages.MD5OfMessageBody
      description: 'MD5 of the message body '
      type: string
    - contextPath: SQS.SentMessages.MessageId
      description: ID of the message
      type: string
    description: Sends a message to the queue
  dockerimage: demisto/boto3
  isfetch: true
  runonce: false
